+  param_argi_ex[test_count_ex] = argi;
+  param_argl_ex[test_count_ex] = argl;
+  param_ret_ex[test_count_ex] = ret;
+  param_len_ex[test_count_ex] = len;
+  param_processed_ex[test_count_ex] = processed != NULL ? *processed : 0;
+  test_count_ex++;
+  return ret;
