augh': 0, 'hooray': 0, 'confused': 0, 'heart': 0, 'rocket': 0, 'eyes': 0}, 'start_line': None, 'original_start_line': None, 'start_side': None, 'line': 196, 'original_line': 196, 'side': 'RIGHT', 'in_reply_to_id': 845834954}, 'pull_request': {'url': 'https://api.github.com/repos/awslabs/aws-lc/pulls/456', 'id': 903308637, 'node_id': 'PR_kwDOD7vRvs4112Vd', 'html_url': 'https://github.com/awslabs/aws-lc/pull/456', 'diff_url': 'https://github.com/awslabs/aws-lc/pull/456.diff', 'patch_url': 'https://github.com/awslabs/aws-lc/pull/456.patch', 'issue_url': 'https://api.github.com/repos/awslabs/aws-lc/issues/456', 'number': 456, 'state': 'open', 'locked': False, 'title': 'Add support for overriding OPENSSL_realloc', 'user': {'login': 'andrewhop', 'id': 41167468, 'node_id': 'MDQ6VXNlcjQxMTY3NDY4', 'avatar_url': 'https://avatars.githubusercontent.com/u/41167468?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/andrewhop', 'html_url': 'https://github.com/andrewhop', 'followers_url': 'https://api.github.com/users/andrewhop/followers', 'following_url': 'https://api.github.com/users/andrewhop/following{/other_user}', 'gists_url': 'https://api.github.com/users/andrewhop/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/andrewhop/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/andrewhop/subscriptions', 'organizations_url': 'https://api.github.com/users/andrewhop/orgs', 'repos_url': 'https://api.github.com/users/andrewhop/repos', 'events_url': 'https://api.github.com/users/andrewhop/events{/privacy}', 'received_events_url': 'https://api.github.com/users/andrewhop/received_events', 'type': 'User', 'site_admin': False}, 'body': '### Issues:
Addresses CryptoAlg-953

### Description of changes: 
Customers can already control most heap memory allocation inside AWS-LC. `OPENSSL_realloc` uses functions that can be overwritten, but it is still opinionated about how realloc should work. This change adds support to define a custom realloc function. This also adds a test for using these weak symbols which is a little cumbersome from C++.

### Callouts
I had to make a new test executable since the way the weak symbols work it overrides it for the entire process. We may want to consider adding support to set these as callback functions like [s2n-tls](https://github.com/aws/s2n-tls/blob/main/utils/s2n_mem.c#L133-L149) which would be easier to test and debug.

### Testing:
Existing unit tests pass and new unit test works and is run by default.

