tions', 'total_count': 0, '+1': 0, '-1': 0, 'laugh': 0, 'hooray': 0, 'confused': 0, 'heart': 0, 'rocket': 0, 'eyes': 0}, 'start_line': None, 'original_start_line': None, 'start_side': None, 'line': 82, 'original_line': 82, 'side': 'RIGHT', 'in_reply_to_id': 827301901}, 'pull_request': {'url': 'https://api.github.com/repos/awslabs/aws-lc/pulls/425', 'id': 880480550, 'node_id': 'PR_kwDOD7vRvs40exEm', 'html_url': 'https://github.com/awslabs/aws-lc/pull/425', 'diff_url': 'https://github.com/awslabs/aws-lc/pull/425.diff', 'patch_url': 'https://github.com/awslabs/aws-lc/pull/425.patch', 'issue_url': 'https://api.github.com/repos/awslabs/aws-lc/issues/425', 'number': 425, 'state': 'open', 'locked': False, 'title': "Convert modulewrapper's Linux specific IO code to use C++ streams", 'user': {'login': 'andrewhop', 'id': 41167468, 'node_id': 'MDQ6VXNlcjQxMTY3NDY4', 'avatar_url': 'https://avatars.githubusercontent.com/u/41167468?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/andrewhop', 'html_url': 'https://github.com/andrewhop', 'followers_url': 'https://api.github.com/users/andrewhop/followers', 'following_url': 'https://api.github.com/users/andrewhop/following{/other_user}', 'gists_url': 'https://api.github.com/users/andrewhop/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/andrewhop/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/andrewhop/subscriptions', 'organizations_url': 'https://api.github.com/users/andrewhop/orgs', 'repos_url': 'https://api.github.com/users/andrewhop/repos', 'events_url': 'https://api.github.com/users/andrewhop/events{/privacy}', 'received_events_url': 'https://api.github.com/users/andrewhop/received_events', 'type': 'User', 'site_admin': False}, 'body': '### Issues:
Addresses CryptoAlg-907

### Description of changes: 
This change replaces all Linux specific headers and APIs with a portable C++ standard library implementation instead of maintaining two platform specific implementations. Summary of issues/changes:
* unistd.h is a POSIX operating system header which is not available on Windows
     *  This provides `STDOUT_FILENO`
* sys/uio.h defines Linux vectorized IO operations
     *  This provides `iovec` which is used by `writev`

### Call-outs:
There could be performance implications switching from vectorizied IO to the buffered streams. The module wrapper is not performance critical and just needs to facilitate testing in a reasonable amount of time. In unscientific experiments locally this change takes the same time as before to run the acvp_tests.

Full Windows support will be added in a follow up PR. This change is needed for Windows support and this does build on Windows. The outstanding test failure will most likely be fixed in acvp.go or check_expected.go.

### Testing:
The run_tests target in our CI runs the acvp_tests which runs the modulewrapper with the existing tests. Timing the execution time with `time` on a Linux machine shows no performance regressions.

By submitting this pull request, I confirm that my contribution is made under the terms of the Apache 2.0 license.
